INSERT INTO `categories` (`id`, `name`, `parent_id`, `thumbnail`, `slug`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Trí tuệ nhân tạo', 1, 'lXygLE6S7jQrpovVbQ7GgzgWMwg1qgCqCmWj9fZl.jpeg', 'tri-tue-nhan-tao', 'Từ một cầu thủ trẻ tài năng nhưng nông nổi, Quế Ngọc Hải đã trở thành thủ lĩnh của đội tuyển Việt Nam. Chẳng ai có thể nghi ngờ tài năng của trung vệ này. Anh đã cho thấy bước trưởng thành vượt bậc trong những năm gần đây. Phần thưởng cho những nỗ lực ấy là tấm băng đội trưởng đội tuyển Việt Nam. Khả năng đọc trận đấu tốt, sự tranh chấp quyết liệt giúp trung vệ sinh năm 1993 là nhân tố quan trọng trong hàng thủ đội tuyển Việt Nam.', '2018-12-27 04:04:12', '2019-01-10 04:13:58'),
(2, 'Lập trình hướng đối tượng', 1, 'JH1rlMoxs1GOHoIx0hj82aO2IMBfKUXNPShN6xO7.png', 'lap-trinh-huong-doi-tuong', 'Sau 10 năm chung sống, cặp đôi có với nhau 3 cô con gái, trong đó có một cặp sinh đôi. Để bảo vệ cuộc sống gia đình, Lê Tư hầu như không bao giờ để lộ mặt con gái trên các phương tiện truyền thông. Trong ảnh, ba con gái của Lê Tư đang trang trí cây thông Noel giúp mẹ. Bức ảnh được nữ diễn viên nổi tiếng chụp và đăng tải trên trang cá nhân vào dịp cuối năm 2018.', '2018-12-27 04:04:12', '2019-01-10 04:14:08'),
(3, 'Cơ sở dữ liệu', 1, '1OGF5aleKIgwCay0x4Jr8H3ECjqNnQrn29Kuj0PE.jpeg', 'co-so-du-lieu', NULL, '2019-01-05 01:45:10', '2019-01-10 04:14:35'),
(4, 'Linux và phần mềm mã nguồn mở', 1, 'jp5GBf6X0igeMkxBpp7jLo5FFK1eWPDJoGbdRr9b.jpeg', 'linux-va-phan-mem-ma-nguon-mo', NULL, '2019-01-05 01:45:45', '2019-01-10 04:13:42'),
