(7, 'Mạng máy tính', 1, 'O656tlWbhuR9D4MdLHm8KGk9ZFGhEHjavQUO1Vuw.jpeg', 'mang-may-tinh', 'Từ một cầu thủ trẻ tài năng nhưng nông nổi, Quế Ngọc Hải đã trở thành thủ lĩnh của đội tuyển Việt Nam. Chẳng ai có thể nghi ngờ tài năng của trung vệ này. Anh đã cho thấy bước trưởng thành vượt bậc trong những năm gần đây. Phần thưởng cho những nỗ lực ấy là tấm băng đội trưởng đội tuyển Việt Nam. Khả năng đọc trận đấu tốt, sự tranh chấp quyết liệt giúp trung vệ sinh năm 1993 là nhân tố quan trọng trong hàng thủ đội tuyển Việt Nam.', '2018-12-27 04:04:12', '2019-01-10 04:13:07'),
(8, 'Công nghệ web và dịch vụ trực tuyến', 1, 'ihLAEnXi9fkitQfxK412vMHPykgXLiUDw0Anelbk.jpeg', 'cong-nghe-web-va-dich-vu-truc-tuyen', 'Nhập môn', '2019-01-08 06:38:25', '2019-01-10 04:15:08'),
