INSERT INTO `posts` (`id`, `title`, `thumbnail`, `description`, `content`, `slug`, `user_id`, `category_id`, `view_count`, `created_at`, `updated_at`) VALUES
(1, 'Tính đóng gói trong java', 'O656tlWbhuR9D4MdLHm8KGk9ZFGhEHjavQUO1Vuw.jpeg', 'Tính đóng gói trong java là kỹ thuật ẩn giấu thông tin không liên quan và hiện thị ra thông liên quan. Mục đích chính của đóng gói trong java là giảm thiểu mức độ phức tạp phát triển phần mềm.', 'adsdsd', 'tinh-dong-goi-trong-java', 1, 2, 35, '2019-01-01 17:00:00', '0000-00-00 00:00:00'),
(2, 'Ghi đè phương thức trong java\r\nGhi đè phương thức trong java\r\nGhi đè phương thức trong java\r\nGhi đè phương thức trong java', '1OGF5aleKIgwCay0x4Jr8H3ECjqNnQrn29Kuj0PE.jpeg', 'Ghi đè phương thức trong java xảy ra nếu lớp con có phương thức giống lớp cha.\r\n\r\nNói cách khác, nếu lớp con cung cấp sự cài đặt cụ thể cho phương thức đã được cung cấp bởi một lớp cha của nó được gọi là ghi đè phương thức (method overriding) trong java.', 'adsdsd', 'ghi-de-phuong-thuc-trong-java', 1, 2, 1, '2019-01-22 17:00:00', '0000-00-00 00:00:00'),
(3, 'Sự khác nhau giữa overloading và overriding trong java', 'i7ZQzdmoZAPibvhNqdtxvrAED5Gfx3QmiGjWmq8k.jpeg', 'adadsd', 'adsdsd', 'overloading-va-overriding-trong-java', 1, 2, 50, '2019-01-15 17:00:00', '0000-00-00 00:00:00'),
(4, 'Nạp chồng phương thức trong java', 'AHnQ9wK4rc5on0HTaTNaDNP3JqYQTahdJdqLH2VM.jpeg', 'Nạp chồng phương thức trong java xảy ra nếu một lớp có nhiều phương thức có tên giống nhau nhưng khác nhau về kiểu dữ liệu hoặc số lượng các tham số.', 'adsdsd', 'nap-chong-phuong-thuc-trong-java', 1, 2, 1, '2019-01-09 17:00:00', '0000-00-00 00:00:00'),
(5, 'Tính đa hình trong java', 'JH1rlMoxs1GOHoIx0hj82aO2IMBfKUXNPShN6xO7.png', 'Đa hình trong java (Polymorphism) là một khái niệm mà chúng ta có thể thực hiện một hành động bằng nhiều cách khác nhau. Polymorphism được cấu tạo từ 2 từ Hy Lạp: poly và morphs. Trong đó “poly” có nghĩa là nhiều và “morphs” có nghĩa là hình thể. Vậy poly', 'adsdsd', 'tinh-da-hinh-trong-java', 1, 2, 10, '2019-01-24 17:00:00', '0000-00-00 00:00:00'),
(6, 'Tính kế thừa trong java\r\n', 'XZzlJ71KJtXGS0Y239eiKp83nGmmToOnFfg4M8YJ.jpeg', 'Kế thừa trong java là sự liên quan giữa hai class với nhau, trong đó có class cha (superclass) và class con (subclass). Khi kế thừa class con được hưởng tất cả các phương thức và thuộc tính của class cha. Tuy nhiên, nó chỉ được truy cập các thành viên pub', 'adsdsd', 'tinh-ke-thua-trong-java', 1, 2, 35, '2019-01-30 17:00:00', '0000-00-00 00:00:00'),
(102, 'Tạm dừng sắp xếp cơ quan chuyên môn cấp tỉnh, huyện: “Bộ Nội vụ không chùn bước”', 'ihLAEnXi9fkitQfxK412vMHPykgXLiUDw0Anelbk.jpeg', 'Ông Vũ Đăng Minh - Chánh văn phòng kiêm người phát ngôn Bộ Nội vụ khẳng định, việc đề nghị UBND các tỉnh, thành phố trực thuộc Trung ương tạm dừng việc sắp xếp các cơ quan chuyên môn cấp tỉnh, cấp huyện để thống nhất, tránh gây ra xáo trộn. “Tôi xin khẳng định, Bộ Nội vụ không phải chùn bước, rút lại đề xuất của mình”- ông nói.', '<p>Tại cuộc họp b&aacute;o thường kỳ chiều 9/1, &ocirc;ng Vũ Đăng Minh - Ch&aacute;nh văn ph&ograve;ng ki&ecirc;m người ph&aacute;t ng&ocirc;n Bộ Nội vụ cho biết, thực hiện &yacute; kiến chỉ đạo của Thủ tướng Ch&iacute;nh phủ, Bộ Nội vụ đ&atilde; đề nghị UBND c&aacute;c tỉnh, th&agrave;nh phố trực thuộc Trung ương tạm dừng việc sắp xếp c&aacute;c cơ quan chuy&ecirc;n m&ocirc;n cấp tỉnh, cấp huyện m&agrave; thời gian qua nhiều nơi đ&atilde; thực hiện để chờ nghị định của Ch&iacute;nh phủ.</p>\n\n<p>Bộ Nội vụ đ&atilde; x&acirc;y dựng 2 dự thảo li&ecirc;n quan đến việc n&agrave;y: Dự thảo nghị định quy định tổ chức c&aacute;c cơ quan chuy&ecirc;n m&ocirc;n thuộc UBND cấp tỉnh v&agrave; dự thảo Nghị định quy định tổ chức c&aacute;c cơ quan chuy&ecirc;n m&ocirc;n thuộc UBND cấp huyện (huyện, quận, thị x&atilde;, th&agrave;nh phố thuộc tỉnh, th&agrave;nh phố trực thuộc Trung ương).</p>\n\n<p>&ldquo;Hiện 2 dự thảo n&agrave;y đ&atilde; được tr&igrave;nh Ch&iacute;nh phủ v&agrave; b&aacute;o c&aacute;o Ban c&aacute;n sự đảng Ch&iacute;nh phủ để tr&igrave;nh Bộ Ch&iacute;nh trị cho &yacute; kiến một số nội dung li&ecirc;n quan đến khung số lượng cơ quan chuy&ecirc;n m&ocirc;n, ti&ecirc;u ch&iacute; th&agrave;nh lập tổ chức, bi&ecirc;n chế tối thiểu, số lượng cấp ph&oacute; tối đa của một tổ chức h&agrave;nh ch&iacute;nh ở địa phương&rdquo;- &ocirc;ng Minh cho hay.</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"Tạm dừng sắp xếp cơ quan chuyên môn cấp tỉnh, huyện: “Bộ Nội vụ không chùn bước” - Ảnh 1.\" id=\"img_403665\" src=\"https://dantricdn.com/2019/1/9/hop-bao-bo-noi-vu-1547028341355172012020.jpg\" title=\"Tạm dừng sắp xếp cơ quan chuyên môn cấp tỉnh, huyện: “Bộ Nội vụ không chùn bước” - Ảnh 1.\" /></p>\n\n<p>&Ocirc;ng Vũ Đăng Minh th&ocirc;ng tin tại buổi họp b&aacute;o (Ảnh: Thế Kha).</p>\n\n<p>&nbsp;</p>\n\n<p>Đại diện Bộ Nội vụ khẳng định, đ&acirc;y l&agrave; 2 nghị định l&agrave;m cơ sở để ph&acirc;n cấp cho ch&iacute;nh quyền địa phương quyết định sắp xếp tổ chức c&aacute;c cơ quan chuy&ecirc;n m&ocirc;n thuộc UBND cấp tỉnh, cấp huyện theo hướng tinh gọn, hoạt động hiệu lực, hiệu quả, bảo đảm ph&ugrave; hợp với đặc điểm đ&ocirc; thị, n&ocirc;ng th&ocirc;n, hải đảo v&agrave; y&ecirc;u cầu quản l&yacute; nh&agrave; nước đối với ng&agrave;nh, lĩnh vực ở địa phương.</p>\n\n<p>Đến nay, một số tỉnh đ&atilde; thực hiện xong việc hợp nhất một số sở, ban, ng&agrave;nh, ph&ograve;ng, ban. Tỉnh L&agrave;o Cai đi đầu hợp nhất Sở Giao th&ocirc;ng vận tải v&agrave; Sở X&acirc;y dựng th&agrave;nh Sở Giao th&ocirc;ng vận tải -X&acirc;y dựng v&agrave;o th&aacute;ng 6/2018.</p>\n\n<p>Sau đ&oacute;, H&agrave; Giang hợp nhất Ban Tổ chức Tỉnh uỷ với Sở Nội vụ, cơ quan Uỷ ban Kiểm tra Tỉnh uỷ với Thanh tra tỉnh, Đảng bộ khối doanh nghiệp tỉnh với Đảng bộ khối cơ quan tỉnh v&agrave;o th&aacute;ng 9/2018.</p>\n\n<p>Đến th&aacute;ng 10/2018, TP Hải Ph&ograve;ng hợp nhất một số cơ quan Đảng với ch&iacute;nh quyền ở cấp huyện như: Văn ph&ograve;ng Quận uỷ với Văn ph&ograve;ng HĐND v&agrave; UBND ở quận Hồng B&agrave;ng, huyện An Dương; Ban Tổ chức huyện uỷ với Ph&ograve;ng Nội vụ ở huyện Kiến Thuỵ; Uỷ ban Kiểm tra huyện uỷ Kiến Thuỵ với Thanh tra huyện.</p>\n\n<p>Mới đ&acirc;y, tỉnh H&agrave; Tĩnh hợp nhất Ban Tổ chức huyện uỷ Đức Thọ với Ph&ograve;ng Nội vụ huyện, hợp nhất Uỷ ban Kiểm tra huyện uỷ với Thanh tra huyện.</p>\n\n<p>Tỉnh Cao Bằng cũng đang tiến h&agrave;nh, đưa ra phương &aacute;n th&iacute; điểm thực hiện hợp nhất một số cơ quan: Đảng bộ khối c&aacute;c cơ quan tỉnh v&agrave; Đảng bộ khối doanh nghiệp tỉnh; cơ quan Uỷ ban Kiểm tra tỉnh uỷ v&agrave; Thanh tra tỉnh; hợp nhất Ban Tổ chức Tỉnh uỷ v&agrave; Sở Nội vụ; Sở Giao th&ocirc;ng vận tải với Sở X&acirc;y dựng; Sở Kế hoạch v&agrave; Đầu tư với Sở T&agrave;i ch&iacute;nh; Sở Th&ocirc;ng tin v&agrave; Truyền th&ocirc;ng với Sở Khoa học v&agrave; C&ocirc;ng nghệ,&hellip;</p>\n\n<p>&Ocirc;ng Vũ Đăng Minh cho biết, tại phi&ecirc;n họp thường k&yacute; th&aacute;ng 11/2018, Thủ tướng Ch&iacute;nh phủ đ&atilde; giao Bộ Nội vụ ra văn bản tạm dừng việc n&agrave;y.</p>\n\n<p>&ldquo;C&oacute; nhiều người hỏi t&ocirc;i chuyện n&agrave;y như thế n&agrave;o?. T&ocirc;i xin khẳng định, Bộ Nội vụ kh&ocirc;ng phải ch&ugrave;n bước, r&uacute;t lại đề xuất của m&igrave;nh. Chỉ l&agrave; trong khi chưa c&oacute; &yacute; kiến đồng nhất th&igrave; tạm dừng lại, để thống nhất, tr&aacute;nh g&acirc;y ra x&aacute;o trộn th&ocirc;i&rdquo;- &ocirc;ng Minh n&oacute;i.</p>\n\n<p>Trước đ&oacute; v&agrave;o th&aacute;ng 4/2018, Bộ Nội vụ đ&atilde; đưa ra lấy &yacute; kiến dự thảo nghị định quy định tổ chức c&aacute;c cơ quan chuy&ecirc;n m&ocirc;n thuộc UBND cấp tỉnh, th&agrave;nh phố trực thuộc Trung ương. Bộ n&agrave;y đề xuất giữ 4 Sở: Tư ph&aacute;p, T&agrave;i nguy&ecirc;n v&agrave; M&ocirc;i trường, Lao động-Thương binh v&agrave; X&atilde; hội, Y tế được tổ chức thống nhất tr&ecirc;n cả nước. C&ograve;n lại hợp nhất, s&aacute;p nhập 17 sở, ng&agrave;nh; giảm 46-88 sở, ng&agrave;nh trong cả nước.</p>', 'tam-dung-sap-xep-co-quan-chuyen-mon-cap-tinh-huyen-bo-noi-vu-khong-chun-buoc', 1, 2, 0, '2019-01-09 23:22:17', '2019-01-09 23:22:17');
