(104, 'Học Máy', 'sCvW4QkC2uTJzG7gaXp9tEvrfrahObNojn0jmlFi.jpeg', 'Nhập môn học máy', '<ol start=\"2\">\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">M&ocirc;i trường Explorer</span></span></span></strong></span></span></li>\n</ol>\n\n<ol>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Preprocess: </span></span></span></span></strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Để chọn v&agrave; thay đổi (xử l&yacute;) dữ liệu l&agrave;m việc.</span></span></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Classify:</span></span></span></span></strong> <span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Để huấn luyện v&agrave; kiểm tra c&aacute;c m&ocirc; h&igrave;nh học m&aacute;y (ph&acirc;n loại, hoặc hồi quy/dự đo&aacute;n</span></span></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Cluster:</span></span></span></span></strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\"> Để học c&aacute;c nh&oacute;m từ dữ liệu (ph&acirc;n cụm)</span></span></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Associate:</span></span></span></span></strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\"> Để kh&aacute;m ph&aacute; c&aacute;c luật kết hợp từ dữ liệu</span></span></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Select attributes:</span></span></span></span></strong> <span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Để x&aacute;c định v&agrave; lựa chọn c&aacute;c thuộc t&iacute;nh li&ecirc;n quan (quan trọng) nhất của dữ liệu.</span></span></span></span></span></span></li>\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Visualize:</span></span></span></span></strong><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\"> Để xem (hiển thị) biểu đồ tương t&aacute;c 2 chiều đối với dữ liệu.</span></span></span></span></span></span></span></li>\n</ol>\n\n<p style=\"margin-left:24px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><img src=\"data:image/png;base64,\" style=\"height:351px; width:624px\" /></span></span></span></span></span></p>\n\n<p style=\"margin-left:24px\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><u><span style=\"font-size:13.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Tiền xử l&yacute; dữ liệu</span></span></span></span></u></strong></span></span></span></p>\n\n<ol start=\"5\" style=\"list-style-type:lower-roman\">\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">C&aacute;c nhiệm vụ ch&iacute;nh :&nbsp; </span></span></span></span></strong></span></span></span></li>\n</ol>\n\n<ul>\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">L&agrave;m sạch dữ liệu(Data cleaning): G&aacute;n c&aacute;c gi&aacute; trị thuộc t&iacute;nh c&ograve;n thiếu, Sửa chữa c&aacute;c dữ liệu nhiễu/lỗi, X&aacute;c định hoặc loại bỏ c&aacute;c ngoại lai (outliers), Giải quyết c&aacute;c m&acirc;u thuẫn dữ liệu.</span></span></span></span></span></span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">T&iacute;ch hợp dữ liệu(Data integration): T&iacute;ch hợp nhiều cơ sở dữ liệu, nhiều khối dữ liệu (data cubes), hoặc nhiều p() tập tin dữ liệu. </span></span></span></span></span></span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Biến đổi dữ liệu(Data transformation): Chuẩn h&oacute;a (normalize) v&agrave; kết hợp (aggregate) dữ liệu.</span></span></span></span></span></span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Giảm bớt dữ liệu(Data reduction):&nbsp; </span></span></span></span></span></span></span></li>\n</ul>\n\n<ul>\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Giảm bớt về biểu diễn (c&aacute;c thuộc t&iacute;nh) của dữ liệu, giảm bớt k&iacute;ch thước dữ liệu &ndash; nhưng vẫn đảm bảo thu được c&aacute;c kết quả khai ph&aacute; dữ liệu tương đương (hoặc xấp xỉ). </span></span></span></span></span></span></span></li>\n</ul>\n\n<ul>\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Rời rạc h&oacute;a dữ liệu(Data discretization): L&agrave; một thao t&aacute;c trong giảm bớt dữ liệu, được sử dụng đối với c&aacute;c dữ liệu c&oacute; c&aacute;c thuộc t&iacute;nh kiểu số.</span></span></span></span></span></span></span></li>\n</ul>\n\n<p style=\"margin-left:48px; text-align:justify\">&nbsp;</p>\n\n<ol start=\"5\" style=\"list-style-type:lower-roman\">\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Tải dữ liệu : </span></span></span></span></strong></span></span></span></li>\n</ol>\n\n<p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Bốn n&uacute;t đầu ti&ecirc;n ở đầu phần tiền xử l&yacute; cho ph&eacute;p load dữ liệu v&agrave;o WEKA:</span></span></span></span></p>\n\n<ol>\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Open file</span></span></strong><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">.... Mở một hộp thoại cho ph&eacute;p bạn duyệt qua c&aacute;c dữ liệu</span></span></span></span></li>\n</ol>\n\n<p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">tập tin tr&ecirc;n hệ thống tập tin địa phương.</span></span></span></span></p>\n\n<p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:black\">Dữ liệu c&oacute; thể được nhập v&agrave;o (imported) từ một tập tin c&oacute; khu&ocirc;n dạng ARFF, CSV.</span></span></span></span></span></span></span></p>\n\n<ol start=\"2\">\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;<strong>Open URL</strong>.... Y&ecirc;u cầu một địa chỉ Uniform Resource Locator cho nơi</span></span></span></span></li>\n</ol>\n\n<p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">dữ liệu được lưu trữ.</span></span></span></span></p>\n\n<p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">3<strong>. &nbsp;Open DB</strong>.... Đọc dữ liệu từ cơ sở dữ liệu. (Lưu &yacute; rằng để thực hiện c&ocirc;ng việc n&agrave;y c&oacute; thể phải chỉnh sửa tệp weka / experiment / DatabaseUtils.props.)</span></span></span></span></p>\n\n<ol start=\"3\">\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Generate</span></span></strong><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">.... Cho ph&eacute;p bạn tạo ra dữ liệu nh&acirc;n tạo từ nhiều DataGenerators.</span></span></span></span></li>\n</ol>\n\n<p style=\"margin-left:24px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><img src=\"data:image/png;base64,\" style=\"height:351px; width:624px\" /></span></span></span></span></p>', 'hoc-may', 1, 1, 0, '2019-01-17 21:58:42', '2019-01-17 21:58:42');

